.nuclide-ui-code-snippet {
  display: flex;
}
.nuclide-ui-code-snippet atom-text-editor[mini] {
  border-top-left-radius: 0;
  border-bottom-left-radius: 0;
  flex: 1;
  font-size: 12px;
  line-height: 28px;
  max-height: none;
}
.nuclide-ui-code-snippet atom-text-editor .highlight.code-snippet-highlight .region {
  background-color: rgba(255, 255, 255, 0.07);
}
.nuclide-ui-code-snippet-line-number-column {
  background: transparent;
  border-top-left-radius: 0.125rem;
  border-bottom-left-radius: 0.125rem;
  font-family: Menlo, Monaco, Consolas, monospace;
  padding: 0 0.5em;
}
.nuclide-ui-code-snippet-line-number {
  color: rgba(0, 0, 0, 0.6);
  line-height: 28px;
}
